import React from 'react';

const PRDs = () => {
  return (
    <section className="py-20 px-6">
      <h2 className="text-4xl font-serif text-red-600 mb-6">Product Required Documents</h2>
      
      {/* Display PDFs as a grid */}
      <div className="grid grid-cols-3 gap-6">
        <div className="border border-red-600 p-4 rounded-lg hover:shadow-lg bg-black">
          <a href="/path-to-prds/PRD1.pdf" target="_blank" rel="noopener noreferrer" className="text-red-600 hover:underline">PRD 1 (PDF)</a>
        </div>
        <div className="border border-red-600 p-4 rounded-lg hover:shadow-lg bg-black">
          <a href="/path-to-prds/PRD2.pdf" target="_blank" rel="noopener noreferrer" className="text-red-600 hover:underline">PRD 2 (PDF)</a>
        </div>
        {/* Add more PRDs as needed */}
      </div>
    </section>
  );
};

export default PRDs;
